import React from 'react';
import { Card } from '@mui/material';

const Posts = ({ posts }) => {

  return (
      <div id='outer div element'>
        {
          posts.map((post) => {
            const { description, location, price, title, _id } = post;
            return (
              <Card 
              variant="outlined"
              width= "2rem">
                <div key={_id}>
                  <h3>{title}</h3>
                  <p>Description: {description}</p>
                  <p>Price: {price}</p>
                  <p>Location: {location}</p>
                </div>
              </Card>
            )
          })
        }
      </div>
  )
}

export default Posts;
